comment.en:
Four alpha-numeric code allocated by ERA to a body. It represent's the Infrastructure Manager (IM) code in RINF.
Infrastructure manager means any body or firm responsible in particular for establishing, managing and maintaining railway infrastructure, including traffic management and control-command and signalling; 
the functions of the infrastructure manager on a network or part of a network may be allocated to different bodies or firms. Definition in (Article 3(2))
